local function display_analysis()
    local tw = TextWindow.new("Message Frequencies")
    local window = TextWindow.new("Message Summary")
    local tab = TextWindow.new("Bar graph")
    local hdr_window = TextWindow.new("Header Analysis")
    local dir = "/Users/joshuameise/.local/lib/wireshark/plugins"
    local file_path = string.format("%s/codes_freq.txt", dir)
    local python_plot_path = string.format("%s/plotter.py", dir)
    local plot_path = string.format("%s/plot.png", dir)

    local function message_freqs()
        local sorted_freq = {}
        local sorted_len = {}

        for k, v in pairs(codes) do
            table.insert(sorted_freq, {code = k, freq = v})
        end
        table.sort(sorted_freq, function(a, b) return a.freq > b.freq end)

        tw:clear()
        tw:append("=====================================================\n")
        tw:append(string.format("|%-12s|%-25s|%-12s|\n", "Message ID", "Message name", "Frequency"))
        tw:append("=====================================================\n")

        for _, id in ipairs(sorted_freq) do
            tw:append(string.format("|%-12d|%-25s|%-12d|\n", id.code, messageName[id.code], id.freq))
        end

        tw:append("=====================================================\n\n\n")

        for k, v in pairs(lengths) do
            table.insert(sorted_len, {len = k, freq = v})
        end
        table.sort(sorted_len, function(a, b) return a.freq > b.freq end)

        tw:append("=======================================\n")
        tw:append(string.format("|%-18s|%-18s|\n", "Length (bytes)", "Frequency"))
        tw:append("=======================================\n")

        for _, val in pairs(sorted_len) do
            tw:append(string.format("|%-18d|%-18d|\n", val.len, val.freq))
        end

        tw:append("=======================================\n")

        ofile = io.open(file_path, "w")

        io.output(ofile)
        
        table.sort(sorted_freq, function(a, b) return a.code < b.code end)

        for _, id in ipairs(sorted_freq) do
            io.write(string.format("%s,%d\n", messageName[id.code], id.freq))
        end

        io.close(ofile)

        local command = string.format("python3 %s %s %s", python_plot_path, file_path, plot_path)
        os.execute(command)

    end

    local function header_fields_analysis()
        local min, max, sums, means, sq_sum, stdv, num

        if #header_fields == 0 then
            return
        end

        sums = {}
        means = {}
        vars = {}
        sq_sum = {}
        stdv = {}
        n = 0

        for a, mess in pairs(header_fields) do
            if a == 1 then
                min = {}
                max = {}
                for key, value in pairs(mess) do
                    min[key] = value
                    max[key] = value
                    sums[key] = 0
                end
            end

            for key, _ in pairs(max) do
                sums[key] = sums[key] + mess[key]
                if mess[key] > max[key] then
                    max[key] = mess[key]
                end
            end

            for key, _ in pairs(min) do
                if mess[key] < min[key] then
                    min[key] = mess[key]
                end
            end
            n = n + 1
        end

        for key, _ in pairs(sums) do
            means[key] = sums[key]/n
        end

        for a, mess in pairs(header_fields) do
            if a == 1 then
                for key, _ in pairs(mess) do
                    sq_sum[key] = 0
                end
            end

            for key, _ in pairs(mess) do
                sq_sum[key] = sq_sum[key] + (means[key] - mess[key])^2
            end
        end
            
        for key, _ in pairs(sums) do
            vars[key] = sq_sum[key]/n
            num = vars[key]
            stdv[key] = math.sqrt(num)
        end

        hdr_window:append(string.format("Header field analysis\n"))       
        hdr_window:append("------------------------------------------------------------------------------------------------------------------------------------------------------------------\n")

        hdr_window:append(string.format("                        %-26s%-26s%-26s%-26s%-26s\n", "minimum:", "maximum:", "mean:", "variance:", "standard deviation:"))
        for key, value in pairs(min) do
            hdr_window:append(string.format("%-22s: %-25s %-25s %-25s %-25s %-25s\n", key, tostring(min[key]), tostring(max[key]), tostring(means[key]), tostring(vars[key]), tostring(stdv[key])))
        end

        hdr_window:append("------------------------------------------------------------------------------------------------------------------------------------------------------------------\n")
        
        local no_constant_fields = 0
        local const = {}

        hdr_window:append(string.format("Constant fields:\n"))

        for key, _ in pairs(max) do
            if max[key] == min[key] then
                table.insert(const, {field = key, value = max[key]})
                no_constant_fields = no_constant_fields + 1
            end
        end

        if no_constant_fields > 0 then
            for _, field in pairs(const) do
                hdr_window:append(string.format("%s: %s\n", field.field, tostring(field.value)))
            end
        else
            hdr_window:append(string.format("No constant fields.\n"))
        end
    end

    local function analysis(structure, window)
        local max, min, const, no_constant_fields, n, sums, means, vars, sq_sum, stdv

        if structure == nil or structure.payload == nil then
            return
        end

        if #structure.payload == 0 then
            return
        end

        sums = {}
        means = {}
        vars = {}
        sq_sum = {}
        stdv = {}
        n = 0

        window:append(string.format("%s:\n", messageName[structure.code]))
        window:append("------------------------------------------------------------------------------------------------------------------------------------------------------------------\n")

        for a, mess in pairs(structure.payload) do
            if a == 1 then
                min = {}
                max = {}
                for key, value in pairs(mess) do
                    min[key] = value
                    max[key] = value
                    sums[key] = 0
                end
            end

            for key, _ in pairs(max) do
                if type(mess[key]) ~= "string" then
                    sums[key] = sums[key] + mess[key]
                end
                if mess[key] > max[key] then
                    max[key] = mess[key]
                end
            end

            for key, _ in pairs(min) do
                if mess[key] < min[key] then
                    min[key] = mess[key]
                end
            end
            n = n + 1
        end

        for key, _ in pairs(sums) do
            means[key] = sums[key]/n
        end

        for a, mess in pairs(structure.payload) do
            if a == 1 then
                for key, _ in pairs(mess) do
                    sq_sum[key] = 0
                end
            end

            for key, _ in pairs(mess) do
                if type(mess[key]) ~= "string" then
                    sq_sum[key] = sq_sum[key] + (means[key] - mess[key])^2
                end
            end
        end
            
        for key, _ in pairs(sums) do
            vars[key] = sq_sum[key]/n
            if type(vars[key]) == "userdata" then
                num = tonumber(tostring(vars[key]))
            else
                num = vars[key]
            end
            stdv[key] = math.sqrt(num)
        end

        window:append(string.format("                    %-26s%-26s%-26s%-26s%-26s\n", "minimum:", "maximum:", "mean:", "variance:", "standard deviation:"))
        for key, value in pairs(min) do
            window:append(string.format("%-18s: %-25s %-25s %-25s %-25s %-25s\n", key, tostring(min[key]), tostring(max[key]), tostring(means[key]), tostring(vars[key]), tostring(stdv[key])))
        end

        window:append("------------------------------------------------------------------------------------------------------------------------------------------------------------------\n")
    
        no_constant_fields = 0
        const = {}

        window:append(string.format("Constant fields:\n"))

        for key, _ in pairs(max) do
            if max[key] == min[key] then
                table.insert(const, {field = key, value = max[key]})
                no_constant_fields = no_constant_fields + 1
            end
        end

        if no_constant_fields > 0 then
            for _, field in pairs(const) do
                window:append(string.format("%s: %s\n", field.field, tostring(field.value)))
            end
        else
            window:append(string.format("No constant fields.\n"))
        end

        window:append("\n==================================================================================================================================================================\n\n\n\n")

    end

    local function display_bar()    
        local html_content = string.format([[
        <html>
        <body>
        <img src="%s" alt="Histogram" style="max-width: 100%%; height: auto;">
        </body>
        </html>
        ]], plot_path)
    
        tab:set(html_content)
    end

    insert_to_table()

    for k, v in ipairs(payloads) do
        analysis(v, window)
    end

    message_freqs()
    display_bar()
    
    os.remove(plot_path)
    os.remove(file_path)

    header_fields_analysis()
end

register_menu("MAVLink Analysis", display_analysis, MENU_ANALYZE_UNSORTED)
